import { Icon } from "../../atoms/icon/icon";
import styles from "./Header.module.css";

export const Header = ({ children }) => {
  return (
    <div className={styles.header}>
      <h1>ADONAI</h1>
      <div>
        <Icon img="/shop-car.svg" alt="menu-bar" link="#"></Icon>
        <Icon img="/icon-menu.svg" alt="menu-bar" link="#"></Icon>
      </div>

      <div>
        <Icon img="/icon-search.svg" alt="menu-bar" link="#"></Icon>
        <Icon img="/icon-menu.svg" alt="menu-bar" link="#"></Icon>
      </div>
    </div>
  );
};
